import * as React from "react";
import { useRef } from "react";
import { motion, useInView } from "framer-motion";
import "./Projects.css";

function Projects() {
  const ref = useRef(null);
  const isInView = useInView(ref, { once: true });
  const list = {
    visible: {
      opacity: 1,
      transition: {
        when: "beforeChildren",
        staggerChildren: 0.2,
      },
    },
  };
  const item = {
    visible: { opacity: 1, y: 0 },
    hidden: { opacity: 0, y: 50 },
  };
  return (
    <React.Fragment>
      <div className="projects-wrapper">
        <section ref={ref}>
          <h2>What I've Built</h2>
          <motion.div
            className="grid"
            initial="hidden"
            animate={isInView ? "visible" : "hidden"}
            variants={list}
          >
            <motion.div variants={item} className="card  col-span-2">
              <h3>Card</h3>
            </motion.div>
            <motion.div variants={item} className="card  col-span-2">
              <h3>Card</h3>
            </motion.div>
            <motion.div variants={item} className="card">
              <h3>Card</h3>
            </motion.div>
            <motion.div variants={item} className="card">
              <h3>Card</h3>
            </motion.div>
          </motion.div>
        </section>
      </div>
    </React.Fragment>
  );
}

export default Projects;
